children.command:
const procedures = {next_available_note_procedures}
var returned_values = {returned_values}
const getTable=(t)=>{tb ={};th=t?.tHead?[...t.tHead.rows[0].cells].map(c=>c.innerText.toLowerCase().replace(/[^a-z\s]/gi,"").trim().replace(/\s/gi,"_")):[];[...t?.tBodies].forEach((ttb,ttbi)=>{tb[ttbi]={};[...ttb.rows].forEach((tbr,tbri)=>{let getRow=(r)=>{let ftbr={};r.forEach((c,ci)=>{ct=c.innerText.trim().toLowerCase();ftbr[th[ci]]=ct.includes("\n")?ct.split("\n"):ct;});return ftbr};tb[ttbi][tbri]=tbr.cells.length==th.length&&th.length>0?getRow([...tbr.cells]):[...tbr.cells].map(c=>c.innerText.trim().toLowerCase())})});return tb}
limits = getTable(document.querySelector(".common-procedures table"))
if (!Boolean(limits))
    console.log(returned_values)//
try{
    returned_values.next_available_note ||= []
    Object.values(limits[0]).forEach(limit=>{
        if (/\d{2}\/\d{2}\/\d{4}/.test(limit.next_available)){
            codes = procedures[limit.type]
            if (codes)
                codes.forEach(code=> {
                    	returned_values.next_available_note.push({[code]:limit.next_available})
                })
        }
    })
}catch(e){
    console.error("Error generating next available note",e)
}

return returned_values

