children.command:
let iframe=document.querySelector("iframe").contentWindow.document
let table_patient= iframe.querySelectorAll('table')[1]
let patient_name = "{patient_name}".toUpperCase();
let patient_last_name = "{patient_last_name}".toUpperCase();
let patient_dob = fillDate("{patient_dob}");
let is_active = 2
let found_patient = false
if(table_patient != undefined){
    Array.from(table_patient.querySelectorAll("tr")).forEach(row => {
        if(row.querySelectorAll("td")[0].innerText.toUpperCase().includes(patient_name) &&
           row.querySelectorAll("td")[2].innerText.includes(patient_dob)){
            found_patient = true;
            if(row.querySelectorAll("td")[4].innerText.trim() == ""){
                is_active = 1;
            }
        }    
    });   
}
let patient_inactive_present = iframe.querySelector(".error-message")?.innerText.toLowerCase().includes("does not have current coverage.")
is_active = found_patient ? is_active : patient_inactive_present ? 2 : 3
function fillDate(date){
    let date_temp = new Date(date);
    let new_day = date_temp.getDate() > 9 ? date_temp.getDate() : "0" + date_temp.getDate();
    let new_month = (date_temp.getMonth() + 1) > 9 ? (date_temp.getMonth() + 1) : "0" + (date_temp.getMonth() + 1);

    return new_month + "/" + new_day + "/" + date_temp.getFullYear();
}

console.log(is_active)
return is_active

let iframe=document.querySelector("iframe").contentWindow
let plan = {configP}["{bot_name}"]["specific_plan_type"] != undefined ? {configP}["{bot_name}"]["specific_plan_type"] : ""
let table_info = Array.from(iframe.document.querySelectorAll("table")).find(item => item.querySelectorAll("tr")[0].innerText.includes("Member Company"))
let table_patient = Array.from(iframe.document.querySelectorAll("table")).find(item => item.querySelectorAll("tr")[0].innerText.includes("Patient"))
let table_max = Array.from(iframe.document.querySelectorAll("table")).find(item => item.querySelectorAll("tr")[0].innerText.includes("Maximums"))
let table_max_rem = Array.from(iframe.document.querySelectorAll("table")).find(item => item.querySelectorAll("tr")[0].innerText.includes("Remaining Maximums"))
let table_deduc = Array.from(iframe.document.querySelectorAll("table")).find(item => item.querySelectorAll("tr")[0].innerText.includes("Deductibles"))
let table_deduc_rem = Array.from(iframe.document.querySelectorAll("table")).find(item => item.querySelectorAll("tr")[0].innerText.includes("Remaining Deductibles"))
let network_mode = {configP}["{bot_name}"]["specific_plan_type"] != undefined ? {configP}["{bot_name}"]["specific_plan_type"] : {configP}["network_mode"]
let returned = {returned_values}
let patient_name = "{patient_name}"
let patient_last_name = "{patient_last_name}"
let patient_dob = "{patient_dob}"
let found_patient = false
let col_ind = 0
let col_fam = 1 
let is_max = false

if(network_mode == "DeltaLegion"){
    col_ind = 2
    col_fam = 3
}else if(network_mode == "Out-of-Network" || network_mode == "OON"){
    col_ind = 4
    col_fam = 5
}

if(table_max != undefined){
    Array.from(table_max.querySelectorAll("tr:not(tr[align='center'])")).forEach(row => {
        let cells = Array.from(row.querySelectorAll("td:not(td[align])"))

        if(row.innerText.includes("Dental Care") && returned["ind_max"] == ""){
            returned["ind_max"] = formatdollar(cells[col_ind].innerText.trim())
        }
    })

    returned["range_of_benefits"] = table_max.querySelector("tr").innerText.match(/\d{0,2}\/\d{0,2}\/\d{4} - \d{0,2}\/\d{0,2}\/\d{4}/)[0]
}

if(table_max_rem != undefined){
    Array.from(table_max_rem.querySelectorAll("tr:not(tr[align='center'])")).forEach(row => {
        let cells = Array.from(row.querySelectorAll("td:not(td[align])"))

        if(row.innerText.includes("Dental Care") && returned["max_rem"] == ""){
            returned["max_rem"] = formatdollar(cells[col_ind].innerText.trim())
            if(parseFloat(cells[col_ind].innerText.trim()) == 0)
                is_max = true
        }
    })
}

if(returned["ind_max"] != "" && returned["max_rem"] != ""){
    let used = parseFloat(returned["ind_max"].replace(/\$|,/gi,"")) -  parseFloat(returned["max_rem"].replace(/\$|,/gi,""))
    returned["annual_used"] = used.toLocaleString('en-US', {style: 'currency',currency: 'USD', minimumFractionDigits: used.toString().includes(".") ? 2 : 0})
}

if(table_deduc != undefined){
    Array.from(table_deduc.querySelectorAll("tr:not(tr[align='center'])")).forEach(row => {
        let cells = Array.from(row.querySelectorAll("td:not(td[align])"))

        if(row.innerText.includes("Dental Care")  && returned["ind_ded"] == ""){
            returned["ind_ded"] = formatdollar(cells[col_ind].innerText.trim())
        }
    })
}

if(table_deduc_rem != undefined){
    Array.from(table_deduc.querySelectorAll("tr:not(tr[align='center'])")).forEach(row => {
        let cells = Array.from(row.querySelectorAll("td:not(td[align])"))

        if(row.innerText.includes("Dental Care")  && returned["ded_rem"] == ""){
            returned["ded_rem"] = formatdollar(cells[col_ind].innerText.trim())
        }
    })
}

if(table_info != undefined){
    Array.from(table_info.querySelectorAll("tr")).forEach(row =>{
        let cells = row.querySelectorAll("td")
        if(cells[0].innerText.includes("Group Number")){
            returned["group_id"] =cells[1].innerText
        }else if(cells[0].innerText.includes("Group Name")){
            returned["group_name"] =cells[1].innerText.replace("'", "`")
        }
    })
}

if(table_patient != undefined){
    Array.from(table_patient.querySelectorAll("tr")).forEach(row => {
        if(row.querySelectorAll("td")[0].innerText.includes(patient_name) && 
           row.querySelectorAll("td")[2].innerText.includes(patient_dob) && found_patient == false){
            returned["term_date"] = row.querySelectorAll("td")[4].innerText.trim()
            returned["effective_date"] = row.querySelectorAll("td")[3].innerText.trim()
        }    
    })   
}

let effectiive_date = returned["effective_date"]

returned['plan_effective_date'] = getEffectivePlanDate(effectiive_date)

//network 
if(plan == ""){
    if({configP}["network_mode"].trim() == "INN")
        plan = "IN"
    else if({configP}["network_mode"].trim() == "OON")
        plan = "OON"
}else{
    if(plan.includes("PPO"))
        plan = "PPO"
    else if(plan.includes("Premier"))
        plan = "PREMIER"
    else if(plan.includes("Non"))
        plan = "NON-DENTAL"
}

returned["network"] = plan

function formatdollar(monto){
    if(monto == "0")
        return parseFloat(monto).toLocaleString('en-US', {style: 'currency',currency: 'USD', minimumFractionDigits: 2})
    else
        return monto
}

function getEffectivePlanDate(date) {
    let today = new Date()
    date = date.replace(/\d{4}/,today.getFullYear())

    if (new Date(date) > today){
        date = date.replace(/\d{4}/,today.getFullYear() - 1)
    }

    return date
}

console.log(returned)
console.log(is_max)
return [returned,is_max]

